import React, { forwardRef } from 'react';
import styled from 'styled-components';
import LogoImage from '../images/logo.svg';

const LogoContainer = styled.div`
  position: absolute;
  top: ${({ isAnimated }) => (isAnimated ? '50px' : '0')};
  left: 50%;
  transform: translateX(-50%) scale(${({ isAnimated }) => (isAnimated ? '0.2' : '1')});
  transform-origin: center top;
  z-index: 100000;
  background-color: rgba(255, 0, 0, 0.5); /* TEMPORAIRE: pour vérifier la visibilité */
  border: 2px solid blue; /* TEMPORAIRE: pour vérifier la visibilité */
`;


const Logo = forwardRef((props, ref) => {
  return <LogoContainer ref={ref} src={LogoImage} alt="Logo" />;
});

export default Logo;
